import React from 'react';
import MediaQuery from 'react-responsive';
import { makeStyles } from '@material-ui/core/styles';
import Typography from '@material-ui/core/Typography';
import theme from '../theme/theme';
import image from '../images/Background.png';
import cutout from '../images/Cutout.png';


const useStyles = makeStyles((theme) => ({
    div: {
        position: "relative",
      },
      "backgroundImage": {
        width: "100%",
      },
      "cutoutImage": {
        color: "white",
        fontWeight: "bold",
        position: "absolute",
        top: "65%",
        left: "40%",
        transform: "translate(-50%, -50%)",
        width: "70%"
      }
}));

export default function App() {

    const classes = useStyles();

    return (
        <div>
            <MediaQuery maxWidth={theme.breakpoints.values.iPhone678Plus}>
            <div className={classes.div}>
                    <img src={image} alt="" className={classes.backgroundImage} />
                    <img src={cutout} alt="" className={classes.cutoutImage} gutterBottom={true}/>

                </div>
            </MediaQuery>

            <MediaQuery minWidth={theme.breakpoints.values.iPhone678Plus + 1} maxWidth={theme.breakpoints.values.iPad}>
            <div className={classes.div}>
                    <img src={image} alt="" className={classes.backgroundImage} />
                    <img src={cutout} alt="" className={classes.cutoutImage} gutterBottom={true}/>

                </div>
            </MediaQuery>

            <MediaQuery minWidth={theme.breakpoints.values.iPad + 1}>

                <div className={classes.div}>
                    <img src={image} alt="" className={classes.backgroundImage} />
                    <img src={cutout} alt="" className={classes.cutoutImage} gutterBottom={true}/>
                </div>
            </MediaQuery>

        </div>
    )
}
